import React, { Component } from "react";
import { Breadcrumb, BreadcrumbItem } from 'reactstrap';
import { Link } from 'react-router-dom';


class User extends Component {
    constructor(props) {
        super(props);
        this.state = {
            users: []
        }
    }

    componentDidMount() {
        fetch('http://localhost:5001/add-user')
            .then( (res) => res.json() )
            .then((data) => {
                console.log(data);
                this.setState({users: JSON.stringify(data)})
            })
            .catch((error) => console.error('Error:', error));
    }

    render() {
        console.log('state',this.state.users)
        const list = this.state.users.map((user) => {
            return (
                <div>
                    <ul>
                        <li>{user}</li>
                    </ul>
                </div>
            )
        })
        return (
            <div>
                <Breadcrumb>
                    <BreadcrumbItem ><Link to="/">Enter User</Link></BreadcrumbItem>
                    <BreadcrumbItem active>Users</BreadcrumbItem>
                </Breadcrumb>
                {list}
            </div>
        )
    }
}

export default User;
